/* eslint-disable prettier/prettier */
import React from 'react';
import {
    StyleSheet,
    Text,
    View,
    Image,
    TextInput,
    Button,
    TouchableOpacity,
} from "react-native";

export default class SplashScreen extends React.Component {
    static navigationOptions = {
        title: 'Menu'
    }

    render() {
        return (
            <View style={styles.container}>
                <View style={styles.row}>
                <View style={styles.column}>
                        <Image style={styles.image} source={{ uri: 'data:image/jpeg;base64,' }} />
                </View>
                <View style={styles.column}>
                    <Text style={styles.forgot_button}>Pizza Name</Text>
                </View>
                </View>
                <View style={styles.row}>
                    <View style={styles.column}>
                        <Image style={styles.image} source={{ uri: 'data:image/jpeg;base64,' }} />
                    </View>
                    <View style={styles.column}>
                        <Text style={styles.forgot_button}>Pizza Name</Text>
                    </View>
                </View>
                <View style={styles.row}>
                    <View style={styles.column}>
                        <Image style={styles.image} source={{ uri: 'data:image/jpeg;base64,' }} />
                    </View>
                    <View style={styles.column}>
                        <Text style={styles.forgot_button}>Pizza Name</Text>
                    </View>
                </View>
            </View>
        )
    }
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: "#fff",
        alignItems: "center",
        justifyContent: "center",
        
    },
    row:{
        flex: 1,
        borderColor: "pink",
        flexDirection: 'row',
        borderWidth: 5,
        height:50
    },
    column: {
        flex: 1,
        flexDirection: 'row',
        width: "50%"
    },

    image: {
        marginBottom: 40,
        width: 200,
        height: 200
    },

    inputView: {
        backgroundColor: "#E8E8E8",
        borderRadius: 30,
        width: "70%",
        height: 45,
        marginBottom: 20,

        alignItems: "center",
    },

    TextInput: {
        height: 50,
        flex: 1,
        padding: 10,
        marginLeft: 20,
        color: "#000000"
    },

    forgot_button: {
        height: 30,
        marginTop: 30,
        marginLeft: 50,
        color: "#006491"
    },

    loginBtn: {
        width: "80%",
        borderRadius: 25,
        height: 50,
        alignItems: "center",
        justifyContent: "center",
        marginTop: 40,
        backgroundColor: "#E42E4B",
    },
    loginText: {
        color: "#f6f6f6"
    }
});